import React from 'react';
import axios from 'axios';
import { Container, DropdownButton, Dropdown, Navbar } from "react-bootstrap";
import './Menu.css';

class Menu extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            brands: [{

            }]
        }
    }

    componentDidMount() {
        this.getBrand()
    }

    getBrand = () => {
        axios.get("http://localhost:8081/admin/get-brands").then((res) => {
            this.setState({ brands: res.data.data });
        }).catch((error) => {
            console.log(error);
        });
    }

    render() {
        return(
            <div>
                <Navbar>
                    <Container>
                        <Form.Control as="select">
                            {
                                this.state.brands.map(item => (
                                    <Dropdown.Item>{item.brand_name}</Dropdown.Item>
                                ))
                            }
                        </Form.Control>
                    </Container>
                </Navbar>
            </div>
        );
    }
}

export default Menu;
